"use client";
import Image from 'next/image';
import { useState } from 'react';
import { textToImage } from '../utils/generateImage';
import { UilImageDownload } from '@iconscout/react-unicons'

export default function Home() {
  let [name, setName] = useState('naruto');
  let [description, setDescription] = useState('naruto is eating ramen at shop alone.');
  let [mood, setMood] = useState('happy');
  let [loading, setLoading] = useState(false);
  let [img, setImage] = useState(demo);
  // Generate an image of [Character], [one or two sentences describing the character's activity]. The character should be [constant description, e.g., in a casual outfit] and situated in a [constant background description, e.g., urban street] with [constant background elements, e.g., buildings, trees]. Ensure that the image captures the essence of [constant mood or emotion, e.g., excitement] and maintains a [constant artistic style, e.g., vibrant colors].

  const handleGenerate = async () => {
    if(!name || !description || !mood) {
      alert('Please fill out all fields.')
      return;
    }

    setLoading(true);
    textToImage(name, description, mood).then((res) => {
        setImage(res.base64);
        setLoading(false);
    }).catch((error) => {
      console.log(error);
      setLoading(false);
    });
  }

  const handleDownload = () => {
    const base64String = `data:image/png;base64,${img}`; // Base64 string
    const binaryString = atob(base64String.split(',')[1]); // Binary data string
    const blob = new Blob([binaryString], { type: 'image/png' });
    const url = window.URL.createObjectURL(blob);

    // Create an anchor element to trigger the download
    const a = document.createElement('a');
    a.href = url;
    a.download = 'sd_local.png';
    document.body.appendChild(a);
    a.click();

     // Clean up
    window.URL.revokeObjectURL(url);
    document.body.removeChild(a);
  }

  return (
    <main className="flex min-h-screen p-24">
        <div className='w-1/4 border-2 border-white'>
            <div className='bg-gray-600 w-full h-full p-4'>
              <h1 className='text-2xl mb-4'>  Describe Character </h1>
              <div className=''> 
                <label htmlFor="name" className='m-2'> Character Name: </label>
                <input className='m-2 p-1 text-black' type="text" id="name" value={name} onChange={(e) => setName(e.target.value)} placeholder="Famous Character. => naruto" />
              </div>
              <div>
                <label htmlFor="description"> Description: </label>
                <textarea className='m-2 w-full p-1 text-black' id="description" cols={30} rows={10} value={description} onChange={(e) => {setDescription(e.target.value)}} placeholder="describe situation or scene with character. e.g. sitting on food stall eathing ramen in hokage cloths" />
              </div>
              <div>
                <label htmlFor="mood"> Mood of the picture: </label>
                <input type="text" className='m-2 p-1 w-full text-black' id="mood" value={mood} onChange={(e) => setMood(e.target.value)} placeholder="mood of the image. e.g. happy, sad"/>
              </div>

              <div className='flex justify-end w-full mt-4'>
                <button className='rounded hover:rounded-lg m-2 p-1 text-black flex-end bg-slate-200 hover:bg-slate-400 disabled:bg-slate-50' 
                  onClick={() => handleGenerate()} disabled={loading}> 
                  Generate 
                </button>
              </div>
            </div>
        </div>
        <div className='w-full border-2 border-white-2 flex flex-col justify-center content-center'>
          {(!loading && !img) ?
            (<h1 className='text-xl text-center text-red-500 align-middle'> No image generated</h1>) : 
            (loading ? (<div className='text-xl align-middle '> loading... </div>) :
            (
            <div className='flex w-full justify-center'>
              <div className='rounded m-5 me-1 border-2 border-white h-fit w-fit'>
                <Image src={`data:image/png;base64,${img}`} alt="generated image" width={512} height={512} className='rounded' objectFit="cover" quality={100} priority={true} placeholder="blur" blurDataURL={img} unoptimized={true} loading="eager" onLoadingComplete={() => {console.log('loaded')}} />
            </div>
            <div className='flex h-full flex-col justify-end pb-5'>
              <button className='rounded hover:rounded-lg p-3 text-black bg-slate-200'
                onClick={() => handleDownload()} disabled={img === ''}>
                <UilImageDownload />
              </button>
            </div>
            </div>))}
        </div>
    </main>
  )
}


const demo = "";